import React from 'react';
import AppBar from '@mui/material/AppBar';

function App() {
    return (
        <div>
            <AppBar
             style={{ 
                backgroundColor: 'white',
                width: 1280 ,
                height: 72 ,
                left: 0 ,
                top: 0  }}>
                 hi
                 
            </AppBar>
        </div>
    )
}

export default App
